import React from 'react';
import logo from './logo.svg';
import './App.css';
import { firestore } from 'firebase/app';

var firebase = require("firebase/app");
require('firebase/auth');
require('firebase/firestore');
const firebaseConfig = {
  apiKey: "AIzaSyBv8L5c8THfMUb95DPsK0-KJz4lfIvjewo",
  authDomain: "tweet2shirt-4c967.firebaseapp.com",
  databaseURL: "https://tweet2shirt-4c967.firebaseio.com",
  projectId: "tweet2shirt-4c967",
  storageBucket: "tweet2shirt-4c967.appspot.com",
  messagingSenderId: "1042027584400",
  appId: "1:1042027584400:web:c93158799bdf5094563115",
  measurementId: "G-LXR2HCQ969"
};
firebase.initializeApp(firebaseConfig);

const db = firebase.firestore();

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <p>{db.collection('products').get()}</p>
      </header>
    </div>
  );
}

export default App;
